import * as React from 'react';

import { InspectorRow } from './InspectorRow';

import './Inspector.css';

interface SelectionInspectorProps {
  selectedData: any;
  onInputChange: (id: string, value: string, isBlur: boolean) => void;
}

export class SelectionInspector extends React.PureComponent<SelectionInspectorProps, {}> {
  /**
   * Render the object data, passing down property keys and values.
   */
  private renderObjectDetails() {
    const selObj = this.props.selectedData;
    console.log('selObj: ', selObj);
    const dets = [];
    for (const k in selObj) {
      if(k==='data'){
        dets.push(<h2>paras:</h2>)

        var data_list = selObj[k].split(";");
        console.log('data_list: ', data_list);
        // for (const item in data_list){
          
        //   let xx=item.split(" ");
        //   let _name=xx[0]
        //   let _value=xx[1]
        //   const row = <InspectorRow
        //   key={_name}
        //   id={_name}
        //   value={_value}
        //   onInputChange={this.props.onInputChange} />;    
        //   dets.push(row);      
        // }
        for(let i=0;i<data_list.length-1;i++){
          let arr = data_list[i].split(" ")
          let _name=arr[0];
          let _value=arr[1]
          const row = <input
          key={_name}
          id={_name}
          value={_value}
           />;    
          dets.push(row);             
        }
        continue;
      }
      const val = selObj[k];
      const row = <InspectorRow
                    key={k}
                    id={k}
                    value={val}
                    onInputChange={this.props.onInputChange} />;
      if (k === 'key') {
        dets.unshift(row); // key always at start
      } else {
        dets.push(row);
      }
    }
    return dets;
  }

  public render() {
    return (
      <div id='myInspectorDiv' className='inspector'>
        <table>
          <tbody>
            {this.renderObjectDetails()}
          </tbody>
        </table>
      </div>
    );
  }
}
